import React from 'react'
import { Form } from "react-bootstrap";

import './timeboxes.css';

class AddItem extends React.Component {
	render () {
		return  <Form onSubmit = {this.addItem}>
					<div className="row mb-3">
						{this.formGroups}
					</div>
					<input className='btn btn-primary' type="submit" value="Submit" />
				</Form>
	}
}

class AddTimebox extends AddItem {
  formGroups =  <Form.Group className='col-12' controlId="formTitle">
					<Form.Label>Name</Form.Label>
					<Form.Control type="text" onChange={event => this.setState({ newTitle: event.target.value })}/>
				</Form.Group>

}

class Timeboxes extends React.Component {
	render() {
		return  <div className='timeboxes-container col-6'>
				  <div className='component-container'>
				    <div className='component-title'>
				  		<span>Timeboxes</span>
				  	</div>
				  	<AddTimebox />
				  </div>
				</div>
	}
}

export default Timeboxes
